










SELECT COUNT(*), bill.account_id, bill_det.service_id FROM bill
INNER JOIN period ON bill.period_id = period.period_id
INNER JOIN account ON account.account_id = bill.account_id
INNER JOIN bill_det ON bill_det.bill_id = bill.bill_id
GROUP BY bill.account_id, service_id
ORDER BY bill.account_id;

SELECT COUNT(*), bill.account_id, adj.service_id FROM bill
INNER JOIN period ON bill.period_id = period.period_id
INNER JOIN account ON account.account_id = bill.account_id
INNER JOIN adj ON adj.bill_id = bill.bill_id
GROUP BY bill.account_id, service_id
ORDER BY bill.account_id;

SELECT COUNT(*), bill.account_id FROM bill
INNER JOIN period ON bill.period_id = period.period_id
INNER JOIN account ON account.account_id = bill.account_id
INNER JOIN payment ON payment.bill_id = bill.bill_id
GROUP BY bill.account_id
ORDER BY bill.account_id;